<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>L'espace <b>Campus France Côte d'Ivoire</b>&nbsp;est le seul interlocuteur <b>100% officiel</b> pour les études supérieures en France.


Le passage par Campus France est un préalable indispensable avant toute demande de visa pour études auprès du consulat général de France en Côte d'Ivoire.


Les équipes de Campus France Côte d'Ivoire ont à coeur de faciliter votre mobilité vers les établissements d'enseignement supérieur français et vous accompagnent dans l'ensemble de vos démarches.<br><br></div>
